import "./style.css"

var page = 0
var length = 0

export default function Caroussel(props) {
    const imgs = props.imgs

    return (
        <div className="caroussel">
            {imgs.map((items, key) => {
                length = items.length
                if (key == page) {
                    return (
                        <img key={key} className="carousselImg" src={items}></img>
                    )
                }

                if (key < 1) {
                    return (
                        <button key={key} onClick={Inc()}></button>
                    )
                }
            })}
        </div>
    )
}

function Inc() {
    if (page <= length) {
        page++
    } else {
        page = 0
    }
}
